 function chn_group_layer_on()

{

	window.clearTimeout(offtimer);  

	var link = document.getElementById('dd_menu_link');

	var pos = findPos(link);

	document.getElementById('chnGroupLayer').style.left="150px";

	document.getElementById('chnGroupLayer').style.top="0px";

	ontimer = window.setTimeout(chn_group_layer_show, 400);

}



function chn_group_layer_off()

{

	offtimer = window.setTimeout(chn_group_layer_hide, 240);

	window.clearTimeout(ontimer);  

}



function chn_group_layer_show()

{

	document.getElementById('chnGroupLayer').style.display='inline';

}



function chn_group_layer_hide()

{

	document.getElementById('chnGroupLayer').style.display='none';

}

function loadChannelGroupLayer(){
	chn_group_layer_on();
	doRequest('channelgrouplayer.php?id=','chnGroupLayer');
